import React from 'react';
import logo from './logo.svg';
import './App.css';


class App extends React.Component {
  constructor(props) {
    super(props)
    this.state={
      update: 0,
      positions: {
        me: {
          left: 500,
          top: 500
        }
      }
    }
  }
  handleKeyPress(e) {
    console.log(e.key)
  }
  render() {
    window.onkeydown=() => this.handleKeyPress(e)
    return (
      <div className="App">
      <h1>TEST</h1>
      </div>
    )
  }
}

export default App;
